(115, 3, 1, '577548484|Nenhum|VESTIDO FEMININO COM FRANZIDO|Vestido feminino com franzido Vestido feminino confeccionado em algodão e elastano, decote redondo na frente e nas costas, franzido na altura do busto, manga curta, acabamento e costura no tom.|Vestido feminino confeccionado em algodão e elastano.|19|1'),
(116, 4, 1, '43955739|Nenhum|CUECA MASCULINA MODELO BOXER LUPO|Cueca masculina modelo Boxer Lupo Cueca confeccionado em algodão e elastano. Possui cós com elástico personalizado da marca, acabamento e costura no tom.|amanhos: P ao EG Cores: preto, vermelho, branco e azul Modelo: Cueca masculina modelo Boxer Lupo Material: algodão e elastano|18.9|1'),
(117, 5, 1, '745725725|Nenhum|BLUSA INFANTIL ELSA DA FROZEN TURMA DA DISNEY|Blusa confeccionada em algodão e elastano, com silk Elsa da Frozen com aplicação de strass e glitter na parte frontal. Possui decote redondo, manga curta, acabamento e costura no tom.|Modelo: Blusa infantil Elsa da Frozen Turma da Disney Material: algodão e elastano Detalhes adicionais: silk Marca: Turma da Disney|15.9|1'),
(118, 6, 1, '47528918|Nenhum|Honda Civic 2008|HONDA NEW CIVIC EXS EQUIPADO COM MULTI MIDIA CASKA, GPS, DVD, RODAS ARO 17 ORIGINAIS HONDA HRV, COM PNEUS MICHELIN EM OTIMO ESTADO.|HONDA NEW CIVIC EXS EQUIPADO COM MULTI MIDIA CASKA, GPS, DVD, RODAS ARO 17 ORIGINAIS HONDA HRV, COM PNEUS MICHELIN EM OTIMO ESTADO.|30000|1'),
(119, 7, 1, '43781741|Nenhum|Fiat Strada 2010|AR CONDICIONADO DIRECAO HIDRAULICA VIDROS E TRAVAS ELETRICAS RODAS DE LIGA LEVE|AR CONDICIONADO DIRECAO HIDRAULICA VIDROS E TRAVAS ELETRICAS RODAS DE LIGA LEVE|26000|1'),
(120, 8, 1, '3847663|Nenhum|Chevrolet Astra S.Sport 2.0 FlexPower 5p/Sport 2.0 3p|Chevrolet Astra 2001 astra 2.0 sport documentação o.k|Chevrolet Astra 2001 astra 2.0 sport documentação o.k|46000|1'),
(121, 9, 1, '478358583|Nenhum|Colcha King Boutis Ponza com 2 Porta Travesseiros|Com essa linda Colcha King com porta travesseiro você decora o quarto com charme e elegância. Produzida em tecido 100% poliéster de alta qualidade, é dupla face e proporciona suavidade, beleza e conforto para o seu lar. Seu design arrojado combina perfeitamente todos os tons e sua charmosa estampa, decorando com harmonia o ambiente. Sua cor moderna pode ser usada de forma harmônica, coordenada de acordo com o estilo de seu quarto e tornando o produto ainda mais atraente. Garanta uma cama sempre charmosa e torne o ambiente do seu descanso mais agradável. Não deixe o estilo e o conforto em segundo plano na hora de repousar. Aproveite para dar um toque de sofisticação na decoração do ambiente, pois você merece todo o conforto e beleza que esta charmosa peça pode oferecer!|Com essa linda Colcha King com porta travesseiro você decora o quarto com charme e elegância. Produzida em tecido 100% poliéster de alta qualidade, é dupla face e proporciona suavidade, beleza e conforto para o seu lar.|200|1'),
(122, 10, 1, '49372847|Nenhum|Jogo de Banho Isabelle com Bordado 5 Peças - Teka|Com a coleção de banho Isabelle da Teka, o seu momento de relaxamento se tornará ainda melhor, pois suas toalhas se caracterizam pela maciez, fineza e design atual, que confere uma combinação perfeita entre todos os seus produtos, decorando com harmonia o ambiente. Confeccionada em algodão de alta qualidade, o jogo de toalhas da Teka possui cores e tecidos que estão sempre em alta na estação deixando a sua casa sempre com ar moderno e atual. Aproveite e tenhas as melhores e mais deliciosas sensações ao utilizar o macio Jogo de Banho Isabelle. São peças analisadas e produzidas para que você se sinta confortável e feliz.|Com a coleção de banho Isabelle da Teka, o seu momento de relaxamento se tornará ainda melhor, pois suas toalhas se caracterizam pela maciez, fineza e design atual.|59.9|1'),
(123, 11, 1, '582854568|Nenhum|Toalha de Mesa Quadrada (160x160cm) Impermeável Porto|Sirva com beleza e elegância! Com nossa toalha de mesa sua receita predileta ganhará um toque especial de sofisticação. Possui estampa exclusiva e moderna, além de muita qualidade. Sua mesa ficará agradável, receptiva e ideal para receber familiares e amigos para um almoço, café ou jantar.|Sirva com beleza e elegância!|39.9|1'),
(124, 12, 1, '943782375734|Nenhum|Home Theater Samsung HT-F5555WK/ZD 5.1 Canais com Blu-ray 3D, Função Futebol, Karaokê, Módulo Wireless, Entrada USB, Cabo HDMI e Lê DVD – 1000 W|Leve para casa uma experiência 3D mais imersiva e espetacular. Com Full HD 3D, o seu entretenimento 3D doméstico será mais emocionante e vivo do que você tinha imaginado, com recursos poderosos para maximizar a sua satisfação.|Leve para casa uma experiência 3D mais imersiva e espetacular. Com Full HD 3D.|2000|1'),
(114, 2, 1, '0002|Nenhum|Smart fortwo 1.0|Com design de linhas fluidas e de superfícies rígidas e estruturadas, a sexta geração levou quatro anos para ficar pronta. Vem equipado com oito airbags, sistema de trava anti-sequestro no interior do porta-malas, coluna de direção retrátil, freio de estacionamento tipo pedal, bancos em couro com ajustes elétricos lombar e de altura (com memória integrada), volante em couro, banco traseiro bipartido com descansa braços central, trio elétrico, espelho retrovisor fotocromático, computador de bordo com tela de LCD com sete funções, teto solar panorâmico e ar-condicionado digital independente com sensor de temperatura interna e filtro antipólem.|Com design de linhas fluidas e de superfícies rígidas e estruturadas, a sexta geração levou quatro anos para ficar pronta.|30000|1'),
(113, 1, 1, '0001|Nenhum|Renaut Sandero|A chuva e a neblina não são suficientes para cobrir o borrão vermelho que se aproxima no retrovisor. Com cara de poucos amigos, olhos fixados no rival à frente, o Punto T-Jet defende sua posição de melhor hot hatch nacional – título que ele conquistou desde 2009 e não vai vender barato. Só que o desafiante chegou forte, com preparação vinda da renomada Renault Sport francesa e um acerto de suspensão digno de carro para track day. Não se engane pela cara de Sandero, meu amigo, pois ao volante este hatch branco aí das fotos pouco lembra o modelo que deu origem a ele. Turbo 1.4 x Aspirado 2.0, 5 marchas x 6 marchas, Itália x França, T-Jet x RS. Está começando o pega mais quente da temporada!|A chuva e a neblina não são suficientes para cobrir o borrão vermelho que se aproxima no retrovisor. Com cara de poucos amigos, olhos fixados no rival à frente, o Punto T-Jet defende sua posição de melhor hot hatch nacional|50000|1'),
