INSERT INTO `catalog_product_entity_text` (`value_id`, `entity_type_id`, `attribute_id`, `store_id`, `entity_id`, `value`) VALUES
(1, 4, 72, 0, 1, 'A chuva e a neblina não são suficientes para cobrir o borrão vermelho que se aproxima no retrovisor. Com cara de poucos amigos, olhos fixados no rival à frente, o Punto T-Jet defende sua posição de melhor hot hatch nacional – título que ele conquistou desde 2009 e não vai vender barato. Só que o desafiante chegou forte, com preparação vinda da renomada Renault Sport francesa e um acerto de suspensão digno de carro para track day. Não se engane pela cara de Sandero, meu amigo, pois ao volante este hatch branco aí das fotos pouco lembra o modelo que deu origem a ele. Turbo 1.4 x Aspirado 2.0, 5 marchas x 6 marchas, Itália x França, T-Jet x RS. Está começando o pega mais quente da temporada!\r\n'),
(2, 4, 73, 0, 1, 'A chuva e a neblina não são suficientes para cobrir o borrão vermelho que se aproxima no retrovisor. Com cara de poucos amigos, olhos fixados no rival à frente, o Punto T-Jet defende sua posição de melhor hot hatch nacional '),
(3, 4, 83, 0, 1, NULL),
(4, 4, 106, 0, 1, NULL),
(11, 4, 72, 0, 2, 'Com design de linhas fluidas e de superfícies rígidas e estruturadas, a sexta geração  levou quatro anos para ficar pronta. Vem equipado com oito airbags, sistema de trava anti-sequestro no interior do porta-malas, coluna de direção retrátil, freio de estacionamento tipo pedal, bancos em couro com ajustes elétricos lombar e de altura (com memória integrada), volante em couro, banco traseiro bipartido com descansa braços central, trio elétrico, espelho retrovisor fotocromático, computador de bordo com tela de LCD com sete funções, teto solar panorâmico e ar-condicionado digital independente com sensor de temperatura interna e filtro antipólem.'),
(12, 4, 73, 0, 2, 'Com design de linhas fluidas e de superfícies rígidas e estruturadas, a sexta geração  levou quatro anos para ficar pronta. '),
(13, 4, 83, 0, 2, NULL),
