(97, 4, 72, 0, 9, 'Com essa linda Colcha King com porta travesseiro você decora o quarto com charme e elegância. Produzida em tecido 100% poliéster de alta qualidade, é dupla face e proporciona suavidade, beleza e conforto para o seu lar. \r\nSeu design arrojado combina perfeitamente todos os tons e sua charmosa estampa, decorando com harmonia o ambiente. Sua cor moderna pode ser usada de forma harmônica, coordenada de acordo com o estilo de seu quarto e tornando o produto ainda mais atraente. \r\nGaranta uma cama sempre charmosa e torne o ambiente do seu descanso mais agradável. Não deixe o estilo e o conforto em segundo plano na hora de repousar. Aproveite para dar um toque de sofisticação na decoração do ambiente, pois você merece todo o conforto e beleza que esta charmosa peça pode oferecer!'),
(98, 4, 73, 0, 9, 'Com essa linda Colcha King com porta travesseiro você decora o quarto com charme e elegância. Produzida em tecido 100% poliéster de alta qualidade, é dupla face e proporciona suavidade, beleza e conforto para o seu lar. '),
(99, 4, 138, 0, 9, NULL),
(100, 4, 83, 0, 9, NULL),
(101, 4, 106, 0, 9, NULL),
(114, 4, 72, 0, 10, 'Com a coleção de banho Isabelle da Teka, o seu momento de relaxamento se tornará ainda melhor, pois suas toalhas se caracterizam pela maciez, fineza e design atual, que confere uma combinação perfeita entre todos os seus produtos, decorando com harmonia o ambiente. Confeccionada em algodão de alta qualidade, o jogo de toalhas da Teka possui cores e tecidos que estão sempre em alta na estação deixando a sua casa sempre com ar moderno e atual. Aproveite e tenhas as melhores e mais deliciosas sensações ao utilizar o macio Jogo de Banho Isabelle. São peças analisadas e produzidas para que você se sinta confortável e feliz.'),
(115, 4, 73, 0, 10, 'Com a coleção de banho Isabelle da Teka, o seu momento de relaxamento se tornará ainda melhor, pois suas toalhas se caracterizam pela maciez, fineza e design atual.'),
